import React from 'react';

function GetInTouch() {
  return (
    <>
      <div className='form-content'>
        <form action=''>
          <div className='form-inputs'>
            <label htmlFor='name' className='form-label' />
            <input type='text' name='name' className='form-input' />
          </div>
        </form>
      </div>
    </>
  );
}

export default GetInTouch;
